import React from "react";
import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import Button from "react-bootstrap/Button";
import { BsCalendarCheck } from "react-icons/bs";
import { AiOutlineClockCircle } from "react-icons/ai";
import { ImLocation } from "react-icons/im";
import boneym from "./../../../media/images/Banners/BoneyM.png";
import { Link } from "react-router-dom";
import salapalatului from "./../../../media/sali/sala-palatului-plan-bun.jpg";

const BoneyMEvent = () => {
  return (
    <div>
      <Card
        className="row d-flex justify-content-center mx-auto mb-5 mt-5"
        style={{ width: "50rem", border: "0" }}
      >
        <Card.Img
          variant="top"
          src={boneym}
          style={{ height: "200px" }}
          className="mb-3 mt-2"
        />
        <Card.Body>
          <Card.Title
            style={{
              fontSize: "50px",
              fontStyle: "italic",
              textAlign: "center",
            }}
          >
            Boney M
          </Card.Title>
          <ListGroup className="list-group-flush">
            <ListGroup.Item>
              <Card.Text style={{ textAlign: "center" }}>
                <p>
                  <BsCalendarCheck class="me-2" />
                  24 Februarie 2024
                  <AiOutlineClockCircle
                    class="me-2"
                    style={{ marginLeft: "3rem" }}
                  />
                  20:00
                </p>
              </Card.Text>
              <Card.Text
                style={{
                  fontSize: "25px",
                  marginTop: "25px",
                  textAlign: "center",
                }}
              >
                <ImLocation /> Sala Palatului, Bucuresti{" "}
                <Card.Img
                  variant="top"
                  src={salapalatului}
                  style={{ height: "200px" }}
                  className="mb-3 mt-2"
                />
              </Card.Text>
            </ListGroup.Item>
          </ListGroup>
          <Button variant="outline-warning" className="ms-2 mt-2">
            <Link to="/boneyM">Cumpara Bilete </Link>
          </Button>{" "}
        </Card.Body>
      </Card>
    </div>
  );
};

export default BoneyMEvent;
